import React from 'react';
import {Switch, Route, Link} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import HomePage from './pages/homepage/homepage.component'

const TitlePage = () => (
  <div>
    <h1>Home Page</h1>
  </div>
)

const TopicsPage = () => (
  <div>
    <h1>Topics Page</h1>
  </div>
)

const TopicsDetailPage = () => (
  <div>
    <h1>Hats Page</h1>
  </div>
)

function App() {
  return (
    <div className="App">
      {/* route gives us 
        - history
          + history.push gives us ability to change routes
        - match
          +
        - location 
          + hash and search
          + pathname gives us the full pathname
        */}
      <Route path='/' component={TitlePage} />
      <Route path='/topics' component={TopicsPage} />
      <Route path='/topics:topicId' component={TopicsDetailPage} />
    </div>
  );
}

export default App;
